import React from "react";
import { IChef } from "../../Types/Interfaces/IChef";
import "./ChefCard.css";
const ChefCard: React.FC<IChef> = (props) => {
  return (
    <div className="cardChef">
      <img className="chefImg" src={props.img} alt={props.firstName} />
      <div className="buttomCard">
        <h3>{props.firstName + " " + props.lastName}</h3>
      </div>
    </div>
  );
};
export default ChefCard;
